const List = () => {
  return `<div>
      <p>Things to do soon</p>
      <p>Interesting things I want to check out</p>
      <ul>
        <li>{Books}</li>
        <li><Movies</li>
        <li>Games</li>
      </ul>
    </div>`;
};

export default List;
